  \"2016-07-27T22:55:00.551933\",\n\t\"name\": \"narrative-report-valentine-national-wildlife-refuge-september-october-november-december-19-c4905\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Valentine NWR
  outlines Refuge accomplishments from September through December of 1961. The report
  begins by summarizing the weather conditions, habitat conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
  reptiles, and fish- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, collections and receipts, vegetation
  control, and wildfires. Resource management is outlined; topics include grazing,
  haying, and fur harvesting. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, and hunting. Items of
  interest, N-R forms, and photographs are attached.\",\n\t\"license_title\": \"License
